    ml: "മുമ്പത്തെ സെഷനിൽ നിന്ന് നിങ്ങളുടെ EasyEyes ഐഡി നൽകണമെന്ന് ഗവേഷകൻ അഭ്യർത്ഥിക്കുന്നു, ദയവായി അത് ഇവിടെ ടൈപ്പ് ചെയ്യുക അല്ലെങ്കിൽ അവസാന സെഷൻ അവസാനിക്കുമ്പോൾ ഡൗൺലോഡ് ചെയ്ത ഫയൽ അപ്‌ലോഡ് ചെയ്യുക.",
