    ar: "يطلب منك الباحث تقديم معرف EasyEyes الخاص بك من الجلسة السابقة، يرجى كتابته هنا، أو تحميل الملف الذي تم تنزيله عند انتهاء الجلسة الأخيرة.",
    hy: "Հետազոտողը խնդրում է, որ դուք տրամադրեք ձեր EasyEyes ID-ն նախորդ նիստից, խնդրում ենք մուտքագրել այն այստեղ կամ վերբեռնել ներբեռնված ֆայլը, երբ վերջին նիստն ավարտվի:",
