    hr: "Istraživač traži da dostavite svoj EasyEyes ID iz prethodne sesije, upišite ga ovdje ili prenesite datoteku preuzetu po završetku posljednje sesije.",
    cs: "Výzkumník vás žádá, abyste uvedli své EasyEyes ID z předchozí relace, zadejte jej sem nebo nahrajte soubor stažený, když poslední relace skončí.",
    da: "Forskeren anmoder om, at du oplyser dit EasyEyes ID fra den forrige session, skriv det her, eller upload filen, der er downloadet, når den sidste session slutter.",
