    el: "Ο ερευνητής ζητά να δώσετε το αναγνωριστικό EasyEyes από την προηγούμενη συνεδρία, πληκτρολογήστε το εδώ ή μεταφορτώστε το αρχείο που κατεβάσατε όταν τελειώσει η τελευταία συνεδρία.",
    he: "החוקר מבקש שתספק את מזהה ה-EasyEyes שלך מהמפגש הקודם, אנא הקלד אותו כאן, או העלה את הקובץ שהורד בסיום ההפעלה האחרונה.",
    hi: "शोधकर्ता अनुरोध करता है कि आप पिछले सत्र से अपनी EasyEyes आईडी प्रदान करें, कृपया इसे यहां टाइप करें, या अंतिम सत्र समाप्त होने पर डाउनलोड की गई फ़ाइल अपलोड करें।",
    hu: "A kutató kéri, hogy adja meg az előző munkamenetből származó EasyEyes azonosítóját, írja be ide, vagy töltse fel az utolsó munkamenet végén letöltött fájlt.",
    is: "Rannsakandi biður þig um að gefa upp EasyEyes auðkenni þitt frá fyrri lotu, vinsamlegast sláðu það inn hér eða hlaðið upp skránni sem var hlaðið niður þegar síðustu lotunni lýkur.",
    id: "Peneliti meminta Anda memberikan ID EasyEyes Anda dari sesi sebelumnya, silakan ketik di sini, atau unggah file yang diunduh saat sesi terakhir berakhir.",
