  RC_findModelBada: {
    "en-US":
      'BADA. Go to Settings > About phone (formerly "About device"). Copy the Model Name and Number to the corresponding fields below.',
    ml: 'ബഡ. ക്രമീകരണങ്ങൾ > ഫോണിനെക്കുറിച്ച് (മുമ്പ് "ഉപകരണത്തെക്കുറിച്ച്") എന്നതിലേക്ക് പോകുക. ചുവടെയുള്ള അനുബന്ധ ഫീൽഡുകളിലേക്ക് മോഡലിൻ്റെ പേരും നമ്പറും പകർത്തുക.',
    tl: 'BADA. Pumunta sa Mga Setting > Tungkol sa telepono (dating "Tungkol sa device"). Kopyahin ang Pangalan ng Modelo at Numero sa mga kaukulang field sa ibaba.',
    ar: 'بادا. انتقل إلى الإعدادات > حول الهاتف (المعروف سابقًا باسم "حول الجهاز"). انسخ اسم النموذج ورقمه إلى الحقول المقابلة أدناه.',
    hy: "ԲԱԴԱ. Գնացեք Կարգավորումներ > Հեռախոսի մասին (նախկինում՝ «Սարքի մասին»): Պատճենեք մոդելի անվանումը և համարը ստորև ներկայացված համապատասխան դաշտերում:",
    bg: "БАДА. Отидете в Настройки > Всичко за телефона (по-рано „Всичко за устройството“). Копирайте името и номера на модела в съответните полета по-долу.",
    "zh-CN":
      "巴达。转到“设置”>“关于手机”（以前称为“关于设备”）。将型号名称和编号复制到下面的相应字段。",
    "zh-HK":
      "巴達。前往“設定”>“關於手機”（以前稱為“關於設備”）。將型號名稱和編號複製到下面的相應欄位。",
    hr: 'BADA. Idite na Postavke > O telefonu (prije "O uređaju"). Kopirajte naziv modela i broj u odgovarajuća polja u nastavku.',
    cs: "BADA. Přejděte do Nastavení > O telefonu (dříve „O zařízení“). Zkopírujte název modelu a číslo do příslušných polí níže.",
    da: 'BADA. Gå til Indstillinger > Om telefonen (tidligere "Om enhed"). Kopier modelnavnet og -nummeret til de tilsvarende felter nedenfor.',
    nl: "BADA. Ga naar Instellingen > Over de telefoon (voorheen 'Over het apparaat'). Kopieer de modelnaam en het modelnummer naar de overeenkomstige velden hieronder.",
    "en-UK":
      'BADA. Go to Settings > About phone (formerly "About device"). Copy the Model Name and Number to the corresponding fields below.',
    "en-US_1":
      'BADA. Go to Settings > About phone (formerly "About device"). Copy the Model Name and Number to the corresponding fields below.',
    fi: 'BADA. Siirry kohtaan Asetukset > Tietoja puhelimesta (aiemmin "Tietoja laitteesta"). Kopioi mallin nimi ja numero alla oleviin vastaaviin kenttiin.',
    fr: "MAUVAIS. Accédez à Paramètres > À propos du téléphone (anciennement « À propos de l'appareil »). Copiez le nom et le numéro du modèle dans les champs correspondants ci-dessous.",
    de: "BADA. Gehen Sie zu Einstellungen > Über das Telefon (früher „Über das Gerät“). Kopieren Sie den Modellnamen und die Modellnummer in die entsprechenden Felder unten.",
    el: 'BADA. Μεταβείτε στις Ρυθμίσεις > Σχετικά με το τηλέφωνο (πρώην "Σχετικά με τη συσκευή"). Αντιγράψτε το Όνομα και τον αριθμό μοντέλου στα αντίστοιχα πεδία παρακάτω.',
    he: 'BADA. עבור אל הגדרות > מידע על הטלפון (לשעבר "אודות המכשיר"). העתק את שם הדגם והמספר לשדות המתאימים למטה.',
    hi: 'बड़ा. सेटिंग्स > फ़ोन के बारे में (पूर्व में "डिवाइस के बारे में") पर जाएँ। मॉडल नाम और संख्या को नीचे संबंधित फ़ील्ड में कॉपी करें।',
    hu: 'BADA. Nyissa meg a Beállítások > A telefonról menüpontot (korábban "Az eszközről"). Másolja a modell nevét és számát az alábbi megfelelő mezőkbe.',
    is: "BADA. Farðu í Stillingar > Um símann (áður „Um tæki“). Afritaðu heiti líkans og númer í samsvarandi reiti hér að neðan.",
    id: 'BADA. Buka Pengaturan > Tentang ponsel (sebelumnya "Tentang perangkat"). Salin Nama Model dan Nomor ke kolom terkait di bawah.',
    it: 'BADA. Vai su Impostazioni > Informazioni sul telefono (in precedenza "Informazioni sul dispositivo"). Copia il nome e il numero del modello nei campi corrispondenti sottostanti.',
    ja: "バダ。 [設定] > [電話情報] (以前の「デバイス情報」) に移動します。モデル名と番号を以下の対応するフィールドにコピーします。",
    kn: 'ಬಡಾ. ಸೆಟ್ಟಿಂಗ್‌ಗಳು > ಫೋನ್ ಕುರಿತು (ಹಿಂದೆ "ಸಾಧನದ ಕುರಿತು") ಗೆ ಹೋಗಿ. ಕೆಳಗಿನ ಅನುಗುಣವಾದ ಕ್ಷೇತ್ರಗಳಿಗೆ ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಸಂಖ್ಯೆಯನ್ನು ನಕಲಿಸಿ.',
    ko: "바다. 설정 > 휴대전화 정보(이전의 '기기 정보')로 이동하세요. 모델명과 번호를 아래 해당 필드에 복사하세요.",
    lt: "BADA. Eikite į „Nustatymai“ > „Apie telefoną“ (anksčiau „Apie įrenginį“). Nukopijuokite modelio pavadinimą ir numerį į atitinkamus toliau pateiktus laukus.",
    ms: 'BADA. Pergi ke Tetapan > Perihal telefon (dahulunya "Perihal peranti"). Salin Nama Model dan Nombor ke medan yang sepadan di bawah.',
    no: "BADA. Gå til Innstillinger > Om telefonen (tidligere «Om enheten»). Kopier modellnavnet og -nummeret til de tilsvarende feltene nedenfor.",
    fa: "BADA. به تنظیمات > درباره تلفن (قبلاً «درباره دستگاه») بروید. نام و شماره مدل را در فیلدهای مربوطه در زیر کپی کنید.",
    pl: "BADA. Wybierz Ustawienia > Informacje o telefonie (dawniej „Informacje o urządzeniu”). Skopiuj nazwę modelu i numer do odpowiednich pól poniżej.",
    pt: 'BADA. Vá para Configurações > Sobre o telefone (anteriormente "Sobre o dispositivo"). Copie o nome e o número do modelo nos campos correspondentes abaixo.',
    ro: "BADA. Accesați Setări > Despre telefon (fost „Despre dispozitiv”). Copiați numele și numărul modelului în câmpurile corespunzătoare de mai jos.",
    ru: "БАДА. Откройте «Настройки» > «О телефоне» (ранее «Об устройстве»). Скопируйте название и номер модели в соответствующие поля ниже.",
    sr: "БАДА. Идите на Подешавања > О телефону (раније „О уређају“). Копирајте назив модела и број у одговарајућа поља испод.",
    es: 'BADA. Vaya a Configuración > Acerca del teléfono (anteriormente "Acerca del dispositivo"). Copie el nombre y el número del modelo en los campos correspondientes a continuación.',
    su: 'BADA. Buka Setélan> Ngeunaan telepon (baheulana "Ngeunaan alat"). Salin Ngaran Model sareng Nomer ka widang anu aya di handap.',
    sw: 'BADA. Nenda kwa Mipangilio > Kuhusu simu (zamani "Kuhusu kifaa"). Nakili Jina la Mfano na Nambari kwa sehemu zinazolingana hapa chini.',
    sv: 'BADA. Gå till Inställningar > Om telefonen (tidigare "Om enheten"). Kopiera modellnamn och nummer till motsvarande fält nedan.',
    tr: 'BADA. Ayarlar > Telefon hakkında (eski adıyla "Cihaz hakkında") seçeneğine gidin. Model Adı ve Numarasını aşağıdaki ilgili alanlara kopyalayın.',
    ur: 'بی اے ڈی اے ترتیبات > فون کے بارے میں (پہلے "آلہ کے بارے میں") پر جائیں۔ ماڈل کا نام اور نمبر نیچے دیے گئے متعلقہ فیلڈز میں کاپی کریں۔',
  },
