    ml: '❌ ക്ഷമിക്കണം, MMM NNN USB മൈക്രോഫോൺ, സീരിയൽ SSS, ഇതുവരെ പ്രൊഫൈൽ ലൈബ്രറിയിൽ ഇല്ല. മറ്റൊരു മൈക്രോഫോൺ പരീക്ഷിക്കുന്നതിന് മുന്നോട്ട് പോകുക അമർത്തുക. അല്ലെങ്കിൽ "നീഡ്സ് പേജിലേക്ക് മടങ്ങുക" അമർത്തുക.',
    tl: '❌ Paumanhin, ang MMM NNN USB microphone, serial SSS, ay wala pa sa profile library. Pindutin ang Magpatuloy upang subukan ang isa pang mikropono. O pindutin ang "Return to Needs Page".',
    ar: '❌ عذرًا، ميكروفون MMM NNN USB، التسلسلي SSS، ليس موجودًا بعد في مكتبة الملفات الشخصية. اضغط على "متابعة" لتجربة ميكروفون آخر. أو اضغط على "الرجوع إلى صفحة الاحتياجات".',
