    no: "Øynene dine er 111 cm unna skjermen, men eksperimentet krever ca. 222 cm. Eksperimentet gjenopptas når du når riktig avstand.",
    fa: "چشمان شما از صفحه نمایش 111 سانتی متر فاصله دارد، اما آزمایش تقریباً به 222 سانتی متر نیاز دارد. زمانی که به فاصله صحیح برسید، آزمایش از سر گرفته می شود.",
    pl: "Twoje oczy znajdują się w odległości 111 cm od ekranu, ale do eksperymentu potrzeba około 222 cm. Eksperyment zostanie wznowiony, gdy osiągniesz odpowiednią odległość.",
