    "en-US_1":
      "PROBLEM? If the distance seems terribly wrong, click here to recalibrate it, and restart this block.",
    fi: "ONGELMA? Jos etäisyys vaikuttaa hirveän väärältä, napsauta tätä kalibroidaksesi sen uudelleen ja käynnistä tämä lohko uudelleen.",
    fr: "PROBLÈME? Si la distance vous semble terriblement fausse, cliquez ici pour la recalibrer, et redémarrez ce bloc.",
    de: "PROBLEM? Wenn der Abstand völlig falsch erscheint, klicken Sie hier, um ihn neu zu kalibrieren, und starten Sie diesen Block neu.",
    el: "ΠΡΟΒΛΗΜΑ? Εάν η απόσταση φαίνεται τρομερά λανθασμένη, κάντε κλικ εδώ για να την επαναβαθμονομήσετε και επανεκκινήστε αυτό το μπλοκ.",
    he: "בְּעָיָה? אם המרחק נראה שגוי מאוד, לחץ כאן כדי לכייל אותו מחדש, והפעל מחדש את הבלוק הזה.",
    hi: "संकट? यदि दूरी बहुत गलत लगती है, तो इसे पुनः कैलिब्रेट करने के लिए यहां क्लिक करें, और इस ब्लॉक को पुनरारंभ करें।",
    hu: "PROBLÉMA? Ha a távolság nagyon rossznak tűnik, kattintson ide az újrakalibráláshoz, és indítsa újra ezt a blokkot.",
    is: "VANDAMÁL? Ef fjarlægðin virðist hræðilega röng, smelltu hér til að endurkvarða hana og endurræstu þessa blokk.",
    id: "MASALAH? Jika jaraknya tampak sangat salah, klik di sini untuk mengkalibrasi ulang, dan mulai ulang blok ini.",
    it: "PROBLEMA? Se la distanza sembra terribilmente sbagliata, fai clic qui per ricalibrarla e riavviare questo blocco.",
    ja: "問題？距離が著しく間違っていると思われる場合は、ここをクリックして距離を再調整し、このブロックを再開してください。",
    kn: "ಸಮಸ್ಯೆ? ದೂರವು ತುಂಬಾ ತಪ್ಪಾಗಿ ಕಂಡುಬಂದರೆ, ಅದನ್ನು ಮರುಮಾಪನ ಮಾಡಲು ಇಲ್ಲಿ ಕ್ಲಿಕ್ ಮಾಡಿ ಮತ್ತು ಈ ಬ್ಲಾಕ್ ಅನ್ನು ಮರುಪ್ರಾರಂಭಿಸಿ.",
    ko: "문제? 거리가 심하게 잘못된 것 같으면 여기를 클릭하여 다시 보정하고 이 블록을 다시 시작하세요.",
    lt: "PROBLEMA? Jei atstumas atrodo labai neteisingas, spustelėkite čia, kad jį iš naujo sukalibruotumėte, ir iš naujo paleiskite šį bloką.",
    ms: "MASALAH? Jika jarak kelihatan sangat salah, klik di sini untuk menentukur semula dan mulakan semula blok ini.",
    no: "PROBLEM? Hvis avstanden virker veldig feil, klikk her for å kalibrere den på nytt, og start denne blokken på nytt.",
    fa: "مسئله؟ اگر فاصله بسیار اشتباه به نظر می رسد، برای تنظیم مجدد آن اینجا را کلیک کنید و این بلوک را مجددا راه اندازی کنید.",
    pl: "PROBLEM? Jeśli odległość wydaje się strasznie niewłaściwa, kliknij tutaj, aby ją ponownie skalibrować i zrestartuj ten blok.",
    pt: "PROBLEMA? Se a distância parecer terrivelmente errada, clique aqui para recalibrá-la e reinicie este bloco.",
    ro: "PROBLEMĂ? Dacă distanța pare teribil de greșită, faceți clic aici pentru a o recalibra și reporniți acest bloc.",
    ru: "ПРОБЛЕМА? Если расстояние кажется вам совершенно неправильным, нажмите здесь, чтобы откалибровать его заново, и перезапустите этот блок.",
    sr: "ПРОБЛЕМ? Ако вам се раздаљина чини страшно погрешном, кликните овде да бисте је поново калибрирали и поново покрените овај блок.",
    es: "¿PROBLEMA? Si la distancia parece terriblemente incorrecta, haga clic aquí para recalibrarla y reinicie este bloque.",
    su: "MASALAH? Lamun jarak sigana pisan salah, klik di dieu pikeun recalibrate eta, sarta balikan deui blok ieu.",
    sw: "TATIZO? Ikiwa umbali unaonekana kuwa mbaya sana, bofya hapa ili kuirekebisha, na uanzishe upya kizuizi hiki.",
    sv: "PROBLEM? Om avståndet verkar väldigt fel, klicka här för att kalibrera om det och starta om det här blocket.",
    tr: "SORUN? Mesafe çok yanlış görünüyorsa, yeniden kalibre etmek için buraya tıklayın ve bu bloğu yeniden başlatın.",
    ur: "مسئلہ؟ اگر فاصلہ بہت غلط لگتا ہے، تو اسے دوبارہ ترتیب دینے کے لیے یہاں کلک کریں، اور اس بلاک کو دوبارہ شروع کریں۔",
