    ko: "1. 아래 상자에 스마트폰이나 USB 마이크의 제조사와 모델을 입력하세요. 애플 아이폰 12 프로.\n",
    lt: "1. Žemiau esančiame laukelyje įveskite išmaniojo telefono arba USB mikrofono markę ir modelį, pvz. Apple iPhone 12 Pro.\n",
    ms: "1. Dalam kotak di bawah, taipkan jenama dan model telefon pintar atau mikrofon USB, mis. Apple iPhone 12 Pro.\n",
    no: "1. I boksen nedenfor skriver du inn merke og modell for smarttelefonen eller USB-mikrofonen, f.eks. Apple iPhone 12 Pro.\n",
    fa: "1. در کادر زیر، مارک و مدل گوشی هوشمند یا میکروفون USB را تایپ کنید، به عنوان مثال. اپل آیفون 12 پرو.\n",
    pl: "1. W polu poniżej wpisz markę i model smartfona lub mikrofonu USB, np.: Apple iPhone 12 Pro.\n",
    pt: "1. Na caixa abaixo, digite a marca e modelo do smartphone ou microfone USB, por exemplo. Apple iPhone 12 Pro.\n",
    ro: "1. În caseta de mai jos, introduceți marca și modelul smartphone-ului sau al microfonului USB, de ex. Apple iPhone 12 Pro.\n",
    ru: "1. В поле ниже введите марку и модель смартфона или USB-микрофона, например. Эпл Айфон 12 Про.\n",
    sr: "1. У поље испод унесите марку и модел паметног телефона или УСБ микрофона, нпр. Аппле иПхоне 12 Про.\n",
    es: "1. En el cuadro a continuación, escriba la marca y modelo del teléfono inteligente o micrófono USB, p. Apple iPhone 12 Pro.\n",
    su: "1. Dina kotak di handap, ketik make jeung model smartphone atawa mikropon USB, misalna. Apple iPhone 12 Pro.\n",
    sw: "1. Katika kisanduku kilicho hapa chini, andika muundo na muundo wa simu mahiri au maikrofoni ya USB, k.m. Apple iPhone 12 Pro.\n",
    sv: "1. I rutan nedan anger du smarttelefonens eller USB-mikrofonens fabrikat och modell, t.ex. Apple iPhone 12 Pro.\n",
    tr: "1. Aşağıdaki kutuya akıllı telefonun veya USB mikrofonun markasını ve modelini yazın; ör. Apple iPhone 12Pro.\n",
    ur: "1. نیچے دیئے گئے باکس میں، اسمارٹ فون یا USB مائکروفون کا میک اور ماڈل ٹائپ کریں، جیسے ایپل آئی فون 12 پرو۔\n",
