    hr: "Kako bismo proizveli točne zvukove, moramo kalibrirati zvučnike. Ovo zahtijeva kalibrirani mikrofon. Imate li pametni telefon (ili USB mikrofon) pri ruci?\n",
    cs: "Abychom produkovali přesný zvuk, musíme reproduktory kalibrovat. To vyžaduje kalibrovaný mikrofon. Máte po ruce chytrý telefon (nebo USB mikrofon)?\n",
    da: "For at producere nøjagtige lyde skal vi kalibrere højttalerne. Dette kræver en kalibreret mikrofon. Har du en smartphone (eller USB-mikrofon) ved hånden?\n",
    nl: "Om nauwkeurige geluiden te produceren, moeten we de luidsprekers kalibreren. Hiervoor is een gekalibreerde microfoon vereist. Heb je een smartphone (of USB-microfoon) bij de hand?\n",
    "en-UK":
      "To produce accurate sounds, we need to calibrate the loudspeakers. This requires a calibrated microphone. Do you have a smartphone (or USB microphone) handy? \n",
    "en-US_1":
      "To produce accurate sounds, we need to calibrate the loudspeakers. This requires a calibrated microphone. Do you have a smartphone (or USB microphone) handy? \n",
    fi: "Jotta voimme tuottaa tarkkoja ääniä, meidän on kalibroitava kaiuttimet. Tämä vaatii kalibroidun mikrofonin. Onko sinulla älypuhelin (tai USB-mikrofoni) käden ulottuvilla?\n",
    fr: "Pour produire des sons précis, nous devons calibrer les haut-parleurs. Cela nécessite un microphone calibré. Avez-vous un smartphone (ou un microphone USB) à portée de main ?\n",
    de: "Um präzise Klänge zu erzeugen, müssen wir die Lautsprecher kalibrieren. Hierzu ist ein kalibriertes Mikrofon erforderlich. Haben Sie ein Smartphone (oder ein USB-Mikrofon) zur Hand?\n",
