    kn: "ಅಯ್ಯೋ, 111 dB ಯ RMS ಫಿಟ್ಟಿಂಗ್ ದೋಷವು 222 dB ಸಹಿಷ್ಣುತೆಯನ್ನು ಮೀರಿದೆ, ಆದ್ದರಿಂದ ಧ್ವನಿವರ್ಧಕವನ್ನು ಮತ್ತೊಮ್ಮೆ ಮಾಪನಾಂಕ ನಿರ್ಣಯಿಸಬೇಕು.",
