    tl: "Kung nag-freeze ang screen na ito, mangyaring kumonekta muli sa pamamagitan ng pagturo ng iyong smartphone camera sa QR code sa screen ng iyong computer. Kapag lumitaw ang isang link, pindutin ito gamit ang iyong daliri.",
    ar: "إذا تجمدت هذه الشاشة، فيرجى إعادة الاتصال عن طريق توجيه كاميرا هاتفك الذكي نحو رمز الاستجابة السريعة الموجود على شاشة الكمبيوتر. عندما يظهر الرابط، المسه بإصبعك.",
    hy: "Եթե ​​այս էկրանը սառչում է, խնդրում ենք նորից միացնել՝ ձեր սմարթֆոնի տեսախցիկը ուղղելով ձեր համակարգչի էկրանի QR կոդի վրա: Երբ հղում է հայտնվում, հպեք դրան ձեր մատով:",
    bg: "Ако този екран замръзне, свържете се отново, като насочите камерата на вашия смартфон към QR кода на екрана на вашия компютър. Когато се появи връзка, докоснете я с пръст.",
    "zh-CN":
      "如果此屏幕冻结，请将智能手机摄像头对准计算机屏幕上的二维码来重新连接。当出现链接时，用手指触摸它。",
    "zh-HK":
      "如果此螢幕凍結，請將智慧型手機相機對準電腦螢幕上的二維碼來重新連接。當出現連結時，用手指觸摸它。",
    hr: "Ako se ovaj zaslon zamrzne, ponovno se povežite usmjeravanjem kamere pametnog telefona prema QR kodu na zaslonu računala. Kada se pojavi poveznica, dodirnite je prstom.",
    cs: "Pokud tato obrazovka zamrzne, znovu se připojte namířením fotoaparátu smartphonu na QR kód na obrazovce počítače. Když se zobrazí odkaz, dotkněte se jej prstem.",
    da: "Hvis denne skærm fryser, bedes du oprette forbindelse igen ved at pege dit smartphone-kamera mod QR-koden på din computerskærm. Når et link vises, skal du trykke på det med din finger.",
    nl: "Als dit scherm vastloopt, maak dan opnieuw verbinding door de camera van uw smartphone op de QR-code op uw computerscherm te richten. Wanneer een link verschijnt, raakt u deze aan met uw vinger.",
    "en-UK":
      "If this screen freezes, please reconnect by pointing your smartphone camera at the QR code on your computer screen. When a link appears, touch it with your finger.",
