    fr: "Si cet écran se fige, veuillez vous reconnecter en pointant l'appareil photo de votre smartphone vers le code QR sur l'écran de votre ordinateur. Lorsqu'un lien apparaît, touchez-le avec votre doigt.",
    de: "Wenn dieser Bildschirm einfriert, stellen Sie bitte die Verbindung wieder her, indem Sie die Kamera Ihres Smartphones auf den QR-Code auf Ihrem Computerbildschirm richten. Wenn ein Link angezeigt wird, berühren Sie ihn mit Ihrem Finger.",
    el: "Εάν αυτή η οθόνη παγώσει, επανασυνδεθείτε στρέφοντας την κάμερα του smartphone σας στον κωδικό QR στην οθόνη του υπολογιστή σας. Όταν εμφανιστεί ένας σύνδεσμος, αγγίξτε τον με το δάχτυλό σας.",
