    lt: "Pasiruošę? Naudokite žymeklį, kad stebėtumėte skersinio plauko centrą, kol pasirodys taikinys. Kryžminis plaukas tampa paryškintas, kai ant jo yra žymeklis.",
    ms: "sedia? Gunakan kursor untuk menjejaki bahagian tengah rambut silang sehingga sasaran muncul. Rambut silang menjadi tebal apabila kursor berada di atasnya.",
    no: "Klar? Bruk markøren til å spore midten av trådkorset til målet vises. Hårkorset blir fet når markøren er på den.",
    fa: "آماده؟ از مکان نما برای ردیابی مرکز موی ضربدری استفاده کنید تا زمانی که هدف ظاهر شود. وقتی مکان نما روی آن باشد، موی ضربدری پررنگ می شود.",
    pl: "Gotowy? Użyj kursora, aby śledzić środek celownika, aż pojawi się cel. Krzyżyk staje się pogrubiony, gdy znajduje się na nim kursor.",
    pt: "Preparar? Use o cursor para rastrear o centro da cruz até que o alvo apareça. A cruz fica em negrito quando o cursor está sobre ela.",
    ro: "Gata? Folosiți cursorul pentru a urmări centrul reticulei până când ținta apare. Crucea devine îndrăzneață când cursorul este pe ea.",
    ru: "Готовый? Используйте курсор, чтобы отслеживать центр перекрестия, пока не появится цель. Перекрестие становится жирным, когда на него наводится курсор.",
    sr: "Спреман? Користите курсор да пратите центар укрштене косе док се не појави мета. Крстић постаје подебљан када је курсор на њему.",
    es: "¿Listo? Utilice el cursor para seguir el centro de la cruz hasta que aparezca el objetivo. La cruz se vuelve negrita cuando el cursor está sobre ella.",
    su: "Siap? Anggo kursor pikeun ngalacak tengah rambut silang dugi ka udagan muncul. Bulu salib janten kandel nalika kursor aya dina éta.",
    sw: "Tayari? Tumia mshale kufuatilia katikati ya nywele za msalaba mpaka lengo linaonekana. Nywele za msalaba huwa na ujasiri wakati mshale uko juu yake.",
